import React, { useEffect, useState } from "react";
import axios from "axios";
import Navbar from "../components/Navbar";
import "../styles/dashboard.css";

function Dashboard() {
    const [stores, setStores] = useState([]);
    const [selectedStore, setSelectedStore] = useState(null);
    const [rating, setRating] = useState(1);
    const [showModal, setShowModal] = useState(false);
    const role = localStorage.getItem("role");

    useEffect(() => {
        const role = localStorage.getItem("role");
    
        if (!role) {
            alert("Unauthorized. Please log in again.");
            window.location.href = "/";
            return;
        }
    
        if (role === "user") {
            fetchStores();  // Normal users fetch all stores
        } else if (role === "store_owner") {
            fetchOwnerStores();  // Store owners fetch only their own store
        }
    }, []);

    const fetchStores = async () => {
        const res = await axios.get("http://localhost:5000/api/stores");
        setStores(res.data);
    };

 ///////////////////////////////////////////

 const fetchOwnerStores = async () => {
    try {
        const token = localStorage.getItem("token");

        if (!token) {
            alert("Unauthorized. Please log in again.");
            window.location.href = "/";
            return;
        }

        console.log("üîç Sending Token:", token); // ‚úÖ Debugging

        const res = await axios.get("http://localhost:5000/api/stores/my", {
            headers: { Authorization: `Bearer ${token}` }
        });

        console.log("‚úÖ Received Store Data:", res.data); // ‚úÖ Debugging

        if (!res.data || Object.keys(res.data).length === 0) {
            alert("No store found for this store owner.");
        } else {
            setStores([res.data]); // ‚úÖ Store the object inside an array
        }
    } catch (err) {
        console.error("‚ùå Error Fetching Store:", err);
        alert("Failed to fetch your store. Please try again.");
    }
};

 //////////////////////////////////////////////////////
    
    


    const submitRating = async () => {
        try {
            const token = localStorage.getItem("token");
            await axios.post(
                "http://localhost:5000/api/ratings",
                { store_id: selectedStore, rating },
                { headers: { Authorization: token } }
            );
            alert("Rating submitted successfully!");
            setShowModal(false);
            fetchStores(); // Refresh store ratings
        } catch (err) {
            alert("Error submitting rating.");
        }
    };

    return (
        <div>
            <Navbar />
            <div className="dashboard-container">
                <h2>üìä {role === "admin" ? "Admin Dashboard" : "User Dashboard"}</h2>

                {role === "user" && (
                    <div>
                        <h3>üè™ All Stores</h3>
                        <table className="table">
                            <thead>
                                <tr>
                                    <th>Store Name</th>
                                    <th>Address</th>
                                    <th>Action</th>
                                </tr>
                            </thead>
                            <tbody>
                                {stores.map((store) => (
                                    <tr key={store.id}>
                                        <td>{store.name}</td>
                                        <td>{store.address}</td>
                                        <td>
                                            <button onClick={() => { setSelectedStore(store.id); setShowModal(true); }}>
                                                Rate Store
                                            </button>
                                        </td>
                                    </tr>
                                ))}
                            </tbody>
                        </table>
                    </div>
                )}

                {showModal && (
                    <div className="modal">
                        <div className="modal-content">
                            <h3>Rate Store</h3>
                            <select value={rating} onChange={(e) => setRating(e.target.value)}>
                                <option value="1">‚≠ê</option>
                                <option value="2">‚≠ê‚≠ê</option>
                                <option value="3">‚≠ê‚≠ê‚≠ê</option>
                                <option value="4">‚≠ê‚≠ê‚≠ê‚≠ê</option>
                                <option value="5">‚≠ê‚≠ê‚≠ê‚≠ê‚≠ê</option>
                            </select>
                            <button onClick={submitRating}>Submit Rating</button>
                            <button className="close-modal" onClick={() => setShowModal(false)}>Cancel</button>
                        </div>
                    </div>
                )}
            </div>
        </div>
    );
}

export default Dashboard;
